llm_output:
function transfer(address recipient, uint256 amount) public {
    require(recipient != address(0), "ERC20: transfer to the zero address");
    require(amount > 0, "ERC20: transfer amount must be greater than zero");
    require(tradingActive, "ERC20: trading is not active");
    require(block.number >= blockForPenaltyEnd, "ERC20: penalty period is still active");

    address sender = msg.sender;

    // Check if sender is excluded from max transaction amount
    if (!_isExcludedMaxTransactionAmount[sender]) {
        require(amount <= maxSellAmount, "ERC20: transfer amount exceeds the max sell amount");
    }

    // Check if recipient is excluded from max transaction amount
    if (!_isExcludedMaxTransactionAmount[recipient]) {
        require(amount <= maxBuyAmount, "ERC20: transfer amount exceeds the max buy amount");
    }

    // Check if the sender is flagged as an early buyer
    if (boughtEarly[sender]) {
        require(recipient == owner || recipient == address(0xdead), "Bots cannot transfer tokens except to owner or dead address");
    }

    // Update balances
    uint256 senderBalance = balanceOf(sender);
    require(senderBalance >= amount, "ERC20: transfer amount exceeds balance");

    _balances[sender] = senderBalance - amount;
    _balances[recipient] += amount;

    emit Transfer(sender, recipient, amount);
}

